'use strict';
let OrderInfo = require('./OrderInfo.js');
//@@DocBrief("The builder of the OrderInfo class")
class OrderInfoBuilder extends OrderInfo {
    setOrderId(orderId) {
        this.orderId = orderId;
    }
    setStatus(status) {
        this.status = status;
    }
    setIsExecuted(isExecuted) {
        this.isExecutedField = isExecuted;
    }
    setTradeId(tradeId) {
        this.tradeId = tradeId;
    }
    setRequestTxt(requestTxt) {
        this.requestTxt = requestTxt;
    }
    setError(error) {
        this.error = error;
    }
    build() {
        return this;
    }
}
module.exports = OrderInfoBuilder
